import { PortfolioProfileStatus } from './portfolio-profile-status.model';
import { PortfolioProfileTechnology } from './portfolio-profile-technology.model';
import { PortfolioProject } from './portfolio-project.model';
export class PortfolioProfile {
  constructor(partial) {
    Object.assign(this, partial);
  }
  deserialize(input) {
    Object.assign(this, input);
    this.status = input.status.map(s => new PortfolioProfileStatus({
      ...s
    }).deserialize(s));
    this.technologies = input.technologies.map(t => new PortfolioProfileTechnology({
      ...t
    }).deserialize(t));
    this.projects = input.projects.map(p => new PortfolioProject({
      ...p
    }).deserialize(p));
    return this;
  }
}
